import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav>
      <img src="/Logo.png" alt="logo" className="logo" />
      <div className="nav-buttons">
        <ul className="b-list">
          <a href="/"><li><span>Home</span></li></a>
          <a href="#"><li><span>Points</span></li></a>
          <a href="#"><li><span>Rewards</span></li></a>
          <a href="#"><li><span>Notifications</span></li></a>
          <a href="#"><li><span>Feedback</span></li></a>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
